import styled from "styled-components";
import {Typography} from "antd";

export const ContentTextStyled = styled(Typography)`
  color: azure;
  font-size: 30px;
  font-weight: bold;
  margin: 15px 0 0 15px;
  text-shadow: 1px 0 1px black;
`
